import { useState } from "react";



const useContactanos = (initalData, onValidate) => {

    const [form, setForm] = useState(initalData);
    const [errors, setErrors] = useState({});
    const [termino, setTermino] = useState(false);

    const handleChangeTermino = (e) => {
        setTermino =  e.target.checked;
    };

    const handleChange = (e) => {
        setForm({
            ...form,
            [e.target.name] : e.target.value,

        })
        console.log(form);
        console.log(form.terminos);

    };

    const handleSubmit = (e) => {
        e.preventDefault();
        const err = onValidate(form)

        if(err === null){
           console.log("enviando..."); 
        }else{
            setErrors(err)
        }


    };


    return {form, errors, handleChange, handleSubmit, handleChangeTermino}
}

export default useContactanos;
